import React from 'react';
import { Link } from 'react-router-dom';

function ProductCard(props) {
  return (
    <div>
      <div>{props.name}</div>
      <div>{`USD: $${props.product.usd}`}</div>{' '}
    </div>
  );
}

export default ProductCard;
